import React from 'react';
/* import '../../App.css'; */
import axios from 'axios';


class SignUp extends React.Component {
    constructor(props) {
        super(props)

        this.state = {

            name: '',
            contactno: '',
            password: "",
            confrimPassword: "",
            email: "",
        }
    }
    handlenameChange = (e) => {
        this.setState({
            name: e.target.value
        })
        console.log("valy", this.state.name)
    }
    handleusernameChange = (e) => {
        this.setState({
            username: e.target.value
        })
    }
    handlecontactChange = (e) => {
        this.setState({
            contactno: e.target.value
        })
    }
    handlepasswordChange = (e) => {
        this.setState({
            password: e.target.value
        })
    }
    handleconfirmpassChange = (e) => {
        this.setState({
            confrimPassword: e.target.value
        })
    }
    handleemailChange = (e) => {
        this.setState({
            email: e.target.value
        })
    }


    handleSubmit = (event) => {
        alert(` ${this.state.name} ${this.state.email}`)
        const data = {
            confirmpassword: this.state.confrimPassword,
            password: this.state.password,
            username: this.state.username,
            contactno: this.state.contactno,
            email: this.state.email,
            name: this.state.name
        }
        console.log("data", data)
        axios({
            method: 'post',
            url: "http://localhost:8080/user/adduser",
            data
        }).then((resp) => console.log("resp", resp))
            .catch(() => { })
        event.preventDefault()
    }


    render() {

       

  return (
    <div className='container'>
      <div className='app-wrapper'>
        <div>
          <h2 className='title'> Create Account</h2>
        </div>
        <form className='form'>
          <div className='name'>
            <label className='label'>name</label>
            <input className='input' type='text'></input>
          </div>
          <div className='email'>
            <label className='label'>Email</label>
            <input className='input' type='email'></input>
          </div>
          <div className='contact'>
            <label className='label'>Contact</label>
            <input className='input' type='contact'></input>
          </div>
          <div className='password'>
            <label className='label'>Password</label>
            <input className='input' type='password'></input>
          </div>
          <div className='submit'>
            <label className='label'>Submit</label>
          
          </div>
        </form>
      </div>
    </div>
  )
}
}
export default SignUp;
